import React from "react";
import { Link } from "react-router-dom";

function Slider(props) {
  return (
    <div id="slider-div" className="d-flex">
      <button className="bg-transparent" id="left-slide-btn">
        <i class="bi bi-arrow-left-square-fill"></i>
      </button>
      <div className="imgDiv d-flex">
        {props.imgUrl.map((i, index) => {
          return (
            <Link to={props.link[index]}>
              <img key={index} src={i} alt="projectImg" />
            </Link>
          );
        })}
      </div>
      {/* <button className="bg-transparent" id="right-slide-btn">
        <i class="bi bi-arrow-right-square-fill"></i>
      </button> */}
    </div>
  );
}

export default Slider;
